import * as React from 'react';
import styles from '../../styles/App.module.scss';
import classNames from 'classnames/bind';
import pen from '../../assets/images/testPen.png';
import { HeaderTitle, Button } from '../../styles/Style';
import MobileDefaultLayoutBottom from '../Default/MobileDefaultLayoutBottom';

const cx = classNames.bind(styles);

function BTConnect() {
  const { noteStore, pageStore } = useStores();
  const navigate = useNavigate();
  const [isShow, setIsShow] = React.useState<boolean>(true);
  const [prevY, setPrevY] = React.useState<number>(0);
  const { currentPage } = useCurrentPage();

  const handleScroll = React.useCallback(
    (e) => {
      const diff = e.target.body.scrollHeight - window.scrollY;
      if (window.scrollY !== 0) {
        setIsShow(false);
      }
      setPrevY(diff);
    },
    // eslint-disable-next-line react-hooks/exhaustive-deps
    [prevY],
  );

  const stopScroll = React.useCallback(() => {
    // console.log("üê∏üê∏üê∏üê∏Î©àÏ∂§", e.target.body.scrollHeight);
    setIsShow(true);
  }, []);

  const throttleScroll = throttle(handleScroll, 200);
  const debounceScroll = debounce(stopScroll, 1000);
  const scrollDetectHandler = React.useCallback(
    (...e: any) => {
      throttleScroll(...(e as []));
      debounceScroll(...(e as []));
    },
    // eslint-disable-next-line react-hooks/exhaustive-deps
    [isShow],
  );

  const saveStroke = (event) => {
    const { stroke } = event;
    stroke.pageUuid = pageStore.currentPage.id;
    stroke.noteUuid = pageStore.currentPage.noteId;

    DatabaseController.instance.saveStroke(stroke);
  };

  const handleCompletedDot = (event) => {
    const { stroke } = event;
    stroke.pageUuid = pageStore.currentPage.id;
    stroke.noteUuid = pageStore.currentPage.noteId;

    NDPSyncController.instance.handleCompletedDot(event);
  };

  const changePage = async (event: IPenToViewerEvent) => {
    const { stroke } = event;
    const pageSOBP = {
      section: stroke.section,
      book: stroke.book,
      owner: stroke.owner,
      page: stroke.page,
    };

    /*
     * PageStoreÏóê ÏùºÏπòÌïòÎäî SOBPÎ•º Í∞ÄÏßÑ pageÍ∞Ä ÏûàÎçîÎùºÎèÑ Í∑∏ ÎÖ∏Ìä∏Í∞Ä ÎπÑÌôúÏÑ±Ìôî ÎèºÏûàÎäî Í≤ΩÏö∞Ïóî ÏÉàÎ°ú ÎßåÎì§Ïñ¥Ï§òÏïºÌï¥
     */
    let targetNoteId = '';
    for (const note of noteStore.noteList) {
      if (
        note.active === true &&
        note.section === pageSOBP.section &&
        note.owner === pageSOBP.owner &&
        note.bookCode === pageSOBP.book
      ) {
        targetNoteId = note.id;
      }
    }

    if (!targetNoteId) {
      const newNoteId = noteStore.createNewNote(pageSOBP);
      targetNoteId = newNoteId;

      pageStore.allPageList[newNoteId] = [];
    }

    const pageId = await pageStore.setCurrentPageBySOBP(pageSOBP, targetNoteId);

    stroke.pageUuid = pageId;
    stroke.noteUuid = targetNoteId;

    navigate(ROUTES.MAIN_PAGE_DETAIL);
  };

  React.useLayoutEffect(() => {
    window.addEventListener('scroll', scrollDetectHandler);
    return () => {
      window.removeEventListener('scroll', scrollDetectHandler);
    };
  }, [scrollDetectHandler]);

  return (
    <>
      <main>
        <div className={styles.Innerwrap}>
          <section className={styles.CommonPage}>
            <HeaderTitle>AI ÏÜåÎ¶¨Ìéú Î°úÍ≥† (Í∞ÄÏ†ú)</HeaderTitle>
            <ul>
              <li className={styles.imgBox}>
                <img src={pen} alt="" />
              </li>
              <li className={cx('mTxt')}>
                Ïó∞Í≤∞Îêú AIÏÜåÎ¶¨Ìéú(Í∞ÄÏ†ú)Í∞Ä
                <br />
                ÏóÜÏñ¥Ïöî.
              </li>
              <li className={cx('mTxt')}>ÏßÄÍ∏à Î∞îÎ°ú Ïó∞Í≤∞Ìï†ÍπåÏöî?</li>
            </ul>
            <Button type="submit" value="Î°úÍ∑∏Ïù∏">
              AI ÏÜåÎ¶¨Ìéú(Í∞ÄÏ†ú) Ïó∞Í≤∞
            </Button>
          </section>
        </div>
      </main>
      <MobileDefaultLayoutBottom isShow={isShow} />
    </>
  );
}
export default BTConnect;
